	(109, '', 'Sésame pour le niveau 100', '', '', '', 'Subida inmediata a nivel 100', 'Subida inmediata a nivel 100', 'Повышение уровня до 100-го', '', '', '', 'Un coup de pouce est parfois le bienvenu pour se mettre à la page et ouvrir les portes du contenu haut niveau de votre aventure. Grâce au Sésame pour le niveau 100, vous pouvez propulser directement au niveau 100 le personnage de votre choix. Rejoignez sans tarder les héros les plus puissants d’Azeroth, des défis épiques vous attendent !', '', '', '', 'Llega un momento en la vida de todo héroe en el que necesita una pequeña ayuda para superar un obstáculo y volver a la acción. Con la subida al nivel 100, podrás poner al día a tu héroe para incorporarte inmediatamente a la vanguardia.', 'Llega un momento en la vida de todo héroe en el que necesita una pequeña ayuda para superar un obstáculo y volver a la acción. Con la subida al nivel 90, podrás poner al día a tu héroe para incorporarte inmediatamente a la vanguardia.', 'У всех героев бывает в жизни трудная полоса. Иногда все так застопорится, что требуется новый импульс. Этим и хорошо единократное повышение уровня одного из ваших персонажей до 100-го. Ваш герой мигом возьмет новую высоту и сможет сразу вступить в бой на передовой.', '', ''),
	(110, '', 'Sésame pour le niveau 90', '', '', '', 'Subida inmediata a nivel 90', 'Subida inmediata a nivel 90', 'Повышение уровня до 90-го', '', '', '', 'Un coup de pouce est parfois le bienvenu pour se mettre à la page et ouvrir les portes du contenu haut niveau de votre aventure. Grâce au Sésame pour le niveau 90, vous pouvez propulser directement au niveau 90 le personnage de votre choix. Rejoignez sans tarder les héros les plus puissants d’Azeroth, des défis épiques vous attendent !', '', '', '', 'Llega un momento en la vida de todo héroe en el que necesita una pequeña ayuda para superar un obstáculo y volver a la acción. Con la subida al nivel 90, podrás poner al día a tu héroe para incorporarte inmediatamente a la vanguardia.', 'Llega un momento en la vida de todo héroe en el que necesita una pequeña ayuda para superar un obstáculo y volver a la acción. Con la subida al nivel 90, podrás poner al día a tu héroe para incorporarte inmediatamente a la vanguardia.', 'У всех героев бывает в жизни трудная полоса. Иногда все так застопорится, что требуется новый импульс. Этим и хорошо единократное повышение уровня одного из ваших персонажей до 90-го. Ваш герой мигом возьмет новую высоту и сможет сразу вступить в бой на передовой.', '', ''),
	(111, '', 'Changement de nom', '', '', '', 'Cambio de nombre', 'Cambio de nombre', 'Смена имени', '', '', '', 'Le nom que vous avez choisi à la création de votre personnage n’est pas voué à rester gravé dans le marbre pour l’éternité. Qui n’a jamais rêvé de revêtir une nouvelle identité pour repartir à zéro dans la fraîche rosée du matin ? Pour votre personnage, c’est possible !', '', '', '', 'El nombre que escogiste inicialmente para tu héroe no tiene por qué ser para toda la eternidad. Quizás te has convertido en un personaje demasiado conocido (o impopular), o simplemente se te ha ocurrido algo mejor. De cualquier manera, ahora puedes cambiar de nombre y comenzar una nueva vida.', 'El nombre que escogiste inicialmente para tu héroe no tiene por qué ser para toda la eternidad. Quizás te has convertido en un personaje demasiado conocido (o impopular), o simplemente se te ha ocurrido algo mejor. De cualquier manera, ahora puedes cambiar de nombre y comenzar una nueva vida.', 'Необязательно всю жизнь носить одно и то же имя. Может, вас утомило, что за вами бегают за автографами (или чтобы дать вам по шее), а может, вам просто пришло в голову что-нибудь получше. В любом случае, новое имя – новая жизнь!', '', ''),
	(112, '', 'Changement de faction', '', '', '', 'Cambio de facción', 'Cambio de facción', 'Смена фракции', '', '', '', 'Un agent double s\'amuse deux fois plus, non ? Partant de ce constat, pourquoi ne pas infiltrer la faction adversaire et découvrir le jeu sous un tout autre jour ? De nouveaux amis, de nouvelles quêtes, de nouveaux paysages… L’herbe est toujours plus verte chez le voisin. Un changement de race vous sera évidemment offert pour tout changement de faction : bienvenue chez vous !', '', '', '', 'Si no puedes con tu enemigo... Sin duda, tus aliados no estarán encantados de verte marchar, pero hay momentos en los que hay que arriesgarse y descubrir cómo es el mundo visto desde el otro lado. Quizás ya tienes amigos allí que te están esperando. Quizás, como dicen muchos, los objetos épicos son realmente más púrpura al otro lado. Los cambios de facción también incluyen un cambio de raza gratis para que puedas encajar entre tus nuevos aliados.', 'Si no puedes con tu enemigo... Sin duda, tus aliados no estarán encantados de verte marchar, pero hay momentos en los que hay que arriesgarse y descubrir cómo es el mundo visto desde el otro lado. Quizás ya tienes amigos allí que te están esperando. Quizás, como dicen muchos, los objetos épicos son realmente más púrpura al otro lado. Los cambios de facción también incluyen un cambio de raza gratis para que puedas encajar entre tus nuevos aliados.', '«Предатель!..» Да, легко бросаться громкими фразами. Вашим союзникам по фракции навряд ли понравится, что вы решили уйти. Но по сути, чем вы, собственно, им обязаны? Может, пора взглянуть, как там у других? Может, у вас там уже есть друзья! Кто знает, вдруг, как говорится, «эпики» действительно фиолетовее там, где нас нет… В смену фракции входит смена расы, чтобы было проще влиться в ряды новых союзников.', '', ''),
	(113, '', 'Changement de race', '', '', '', 'Cambio de raza', 'Cambio de raza', 'Смена расы', '', '', '', 'Ce n’est pas tous les jours facile d’avoir cinq doigts à chaque main, des oreilles pointues, la peau verdâtre ou de se retrouver couvert de poils rêches à chaque fois que vous vous cognez le genou sur un coin de table. Parfois, on aimerait pouvoir tout changer. Réjouissez-vous : c’est possible !', '', '', '', 'No es fácil ser verde... o azul... o rosa purpúreo de orejas puntiagudas. A veces un simple retoque a la imagen de tu personaje no es suficiente. A veces necesitas ir más allá y cambiar por completo. Con un cambio de raza, puedes conseguirlo.', 'No es fácil ser verde... o azul... o rosa purpúreo de orejas puntiagudas. A veces un simple retoque a la imagen de tu personaje no es suficiente. A veces necesitas ir más allá y cambiar por completo. Con un cambio de raza, puedes conseguirlo.', 'Генетика — жестокая штука. Попробуй поживи все время зеленым. Или синим. Или фиолетовым. И к тому же остроухим. Иногда косметической смены имиджа недостаточно и требуются радикальные меры: сменить расу напрочь!', '', ''),
	(114, '', 'Changement d\'apparence', '', '', '', 'Cambio de apariencia', 'Cambio de apariencia', 'Измени персонажа', '', '', '', 'Dans la vie, tout change : les coiffures, les gens, les goûts… Peut-être en avez-vous assez de l’apparence de votre personnage, ou souhaitez-vous le faire changer de sexe ? Peut-être feriez-vous aujourd’hui des choix différents quant à son physique ? Voici le service qu’il vous faut ! Vous pouvez désormais réinventer (presque) complètement votre personnage. Parce que vous le valez bien ', '', '', '', 'Las cosas cambian, la gente cambia, las modas cambian, las primas de riesgo fluctúan… Si estás cansado de tu sempiterno casco de placas para ocultar el look de tu personaje, entonces el cambio de apariencia es lo que necesitas. Piensa en ello como una segunda oportunidad que muchos desearían que existiera en la vida real. Este cambio te permite rehacer el look e incluso el género de uno de tus personajes.', 'Las cosas cambian, la gente cambia, las modas cambian, las primas de riesgo fluctúan… Si estás cansado de tu sempiterno casco de placas para ocultar el look de tu personaje, entonces el cambio de apariencia es lo que necesitas. Piensa en ello como una segunda oportunidad que muchos desearían que existiera en la vida real. Este cambio te permite rehacer el look e incluso el género de uno de tus personajes.', 'Все течет, все изменяется. Люди, стрижки, процентные ставки… Если вам надоело, как выглядит ваш персонаж, а разгуливать в шлеме с опущенным забралом не хочется, то эта услуга придется вам очень кстати. Еще бы такую в реальной жизни…! Вы можете полностью изменить облик и даже, если хотите, пол своего персонажа.', '', ''),
	(115, '', 'Personnage pré-équipé niveau 100', '', '', '', 'prefabricado nivel 100', 'prefabricado nivel 100', 'персонажа 100 уровень', '', '', '', 'L\'achat d\'un personnage pré-équipé comporte :\r\n- L\'équipement de la "Saison 1 de Warlords" de qualité rare et d\'ilvl 600.\r\n- Les armes fournies sont d\'ilvl 610.\r\n- Les bijoux et la cape sont d\'ilvl 610.\r\n- Vous aurez 10 000 Po.\r\n- Le personnage est de niveau 100.\r\n- Une monture volante : Wyrm de givre du gladiateur courroucé', '', '', '', 'Comprar un jugador prefabricado incluye:\r\n- Armadura PvP de nivel 600.\r\n- Armas de nivel 610.\r\n- Abalorios y capas de nivel 610.\r\n- 10.000 monedas de oro.\r\n- Nivel 100 instantáneo.\r\n- Una montura PvP única: Vermis de escarcha de Gladiador colérico.', 'Comprar un jugador prefabricado incluye:\r\n- Armadura PvP de nivel 600.\r\n- Armas de nivel 610.\r\n- Abalorios y capas de nivel 610.\r\n- 10.000 monedas de oro.\r\n- Nivel 100 instantáneo.\r\n- Una montura PvP única: Vermis de escarcha de Gladiador colérico.', 'Выбирая готового персонажа вы получите:\r\n- iLevel 600 PvP экипировку\r\n- iLevel 610 оружие\r\n- iLevel 610 аксессуары и плащ\r\n- 10 000 золота\r\n- Мгновенный 100 уровень\r\n- Уникального PvP верхового животного: Ледяной змей разгневанного гладиатора', '', ''),
